import React from "react";
import style from "./MealItem.module.css";

const MealItem = (props) => {
  const listMeals = props.meals.map((meal) => {
    return (
      <li>
        <div>
          <h3>{meal.name}</h3>
        </div>
        {meal.description} {meal.price}
      </li>
    );
  });

  return <p>{listMeals} </p>;
};

export default MealItem;
